import { makeAutoObservable } from "mobx";

class Delete {
    value = 212;
    constructor() {
        makeAutoObservable(this)
    }

    deleteInput() {
        this.value = '';
    }

    setInput(num) {
        this.value = this.value + num
    }
}

export default new Delete()
